import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import AppRoutes from "./routes/AppRoutes";
function App() {
 return (
 <Router>
 <div>
 <h1>Test React: Gérer les équipements</h1>
 <AppRoutes />
 </div>
 </Router>
 );
}
export default App;
